import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Login from './components/Login';
import Generator from './components/Generator';

function App() {


  return (
    <Router>

          <Route exact path="/" element={< Generator/>} />
          <Route path="/login" element={< Login/>} />

    </Router>

  )
}

export default App;
